  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除，1是0否，配合软删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`,`email`),
  KEY `role` (`role`,`status`,`create_time`,`update_time`,`login_ip`,`login_count`,`is_delete`)
